,p_process_name=>'Global_Load_Data'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'declare ',
' v_cnt number;',
'begin',
'--------',
'--Globale Settings',
'',
':P0_DEFAULT_LANGUAGE := :DEFAULT_LANGUAGE;',
'',
'-----',
'select hgs_parm_value, hgs_parm_color, hgs_parm_backgroundcolor',
'into :P0_ENVIRONMENT, :P0_ENVIRONEMNTCOLOR, :P0_ENVIRONMENT_BGCOLOR',
'from hgs_parameter_db par',
'  join (select * from hgs_parameter_group_db where hgs_parm_group_name = ''HGS_ENV'') pargroup on pargroup.hgs_parameter_group_db_pk = par.hgs_parameter_group_db_fk',
'  join hgs_rel_app_parameter_db relapppar on relapppar.HGS_PARAMETER_DB_FK =par.hgs_parameter_db_pk',
'  join (select * from hgs_app_pages where hgs_app_pages_APPlication_ID = :APP_ID and hgs_app_pages_page_id is null) app on app.hgs_app_pages_primkey = relapppar.hgs_app_pages_fk;',
'-----------',
'--Sprache',
'    :P0_SPRACHE :=HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_SPRACHE''',
'    );',
'',
'Select Case  When :P0_LANGUAGE = ''DE'' and :P0_DEFAULT_LANGUAGE = ''DE'' THEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_DEUTSCH''',
'    ) || ''</b> (DEFAULT)''',
'    When :P0_LANGUAGE = ''DE'' tHEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_DEUTSCH''',
'    ) || ''</b>'' When :P0_DEFAULT_LANGUAGE = ''DE'' Then HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_DEUTSCH''',
'    ) || '' (DEFAULT)'' else HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_DEUTSCH''',
'    )  end ',
'into :P0_DEUTSCH ',
'from dual;',
'',
'Select Case  When :P0_LANGUAGE = ''EN'' and :P0_DEFAULT_LANGUAGE = ''EN'' THEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_ENGLISCH''',
'    ) || ''</b> (DEFAULT)''',
'    When :P0_LANGUAGE = ''EN'' tHEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_ENGLISCH''',
'    ) || ''</b>'' When :P0_DEFAULT_LANGUAGE = ''EN'' Then HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_ENGLISCH''',
'    ) || '' (DEFAULT)'' else HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_ENGLISCH''',
'    )  end ',
'into :P0_ENGLISCH ',
'from dual;',
'',
'Select Case  When :P0_LANGUAGE = ''FR'' and :P0_DEFAULT_LANGUAGE = ''FR'' THEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_FRANZOESISCH''',
'    ) || ''</b> (DEFAULT)''',
'    When :P0_LANGUAGE = ''FR'' tHEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
