'Select Case  When :P0_LANGUAGE = ''ES'' and :P0_DEFAULT_LANGUAGE = ''ES'' THEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
