'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_SPANISCH''',
'    ) || ''</b> (DEFAULT)''',
'    When :P0_LANGUAGE = ''ES'' tHEN ''<b>'' || HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
'        :P0_DEFAULT_LANGUAGE,          ',
'        ''P0_SPANISCH''',
'    ) || ''</b>'' When :P0_DEFAULT_LANGUAGE = ''ES'' Then HGS_TEXTS_PACKAGE."GET_RO_FC_HGS_TEXTS_DB" (          ',
'        :P0_LANGUAGE,  ',
