'declare',
'  v_datei     blob;',
'  v_dateiname HGS_X_TICKET_BLOBS_DB.HGS_X_UPL_FILENAME%type;',
'  v_mimetype  HGS_X_TICKET_BLOBS_DB.HGS_X_UPL_MIMETYPE%type;',
'begin',
'  begin',
'    select',
'      blob_content,',
'      filename,',
'      mime_type',
'    into v_datei, v_dateiname, v_mimetype',
